import React from "react";
import { Parallax, ParallaxLayer } from '@react-spring/parallax'
import './component styles/Home.css';
import automotiveIndustry from '../assets/images/automotive_industry.jpg'
import Blur from "react-blur";

function Home(){
    return(
        <div className="centered-div" style={{marginTop: 50, backgroundColor: '#96C161'}}>
            <Parallax pages={3}>

                <ParallaxLayer 
                    speed={0.1}
                    >
                        <h1>Motivation</h1>
                </ParallaxLayer>

                <ParallaxLayer 
                    offset={1} 
                    speed={1} 
                    style={{
                        backgroundImage: <Blur 
                            img={'../assets/images/automotive_industry.jpg'}
                            blurRadius={5}
                            enableStyles
                        ></Blur>,
                        backgroundSize: 'cover',
                    }}
                    >
                        <h2>A Need in the Automotive Industry</h2>
                </ParallaxLayer>

            </Parallax>
        </div>
    );
}

export default Home;
